Dueto narys Valteris Fridenbergsas diagnozę išgirdo prieš metus, tačiau visuomenės dėmesio sulaukė dabar, kai išdrįso prabilti apie tai viešai. Ir ne tik prabilti, bet ir paprašyti paramos. Diagnozavus vėžį vaikinui jau buvo atlikta operacija, jis iškentė ir tris chemoterapijos kursus. Ir nors buvo galvojama, kad liga traukiasi, šią vasarą išgirdo, jog vėžys atsinaujino – jau pasiekė limfmazgius ir yra dar žalingesnis. „Eurovizinis“ dueto pasirodymas: Deja, gydymas, kurį gali suteikti Latvijos medikai, nepakankamas, todėl Valteris privalo ieškoti pagalos svetur. Tačiau gauti reikalingą gydymą nėra lengva – vien pirminis gydymas  Vokietijos  klinikoje jam kainuotų 17 500 eurų. Tolimesnis gydymas – dešimteriopai brangiau. Kaip skelbia wiwibloggs.com, Valteriui viešai paprašius paramos, latviai jau paaukojo jam 100 tūkst. eurų. „Walters & Kazha“: Beje, pats Valteris ne vienerius metus intensyviai padeda sergantiems, inicijuoja projektus ir prisijungia, jei yra kviečiamas, tad skelbiama, jog latviai savo parama jam atsilygina už prieš tai dėtas pastangas. DELFI primena, jog duetas „Walters & Kazha“ „Eurovizijoje“ dalyvavo 2005 metais ir pelnė penktąją vietą. Konkurse latviai atliko dainą „The War Is Not Over“, kuri pavergė daugelio lietuvių širdis. Prieš kelerius metus latviai viešėjo projekte „ Chorų karai “. Valteris pagalbos prašo ir platindamas vaizdo įrašą, kuriame iš anksto dėkoja galintiems prisidėti: (function(d, s, i, r) {
